import React, { Component } from 'react';
import { Layout, Menu } from 'antd';
const { SubMenu } = Menu;
const { Header, Content, Sider } = Layout;

class MSider extends Component {
  render() {
    return (
      <Layout>
        <Sider width={300}>
          <Menu
            style={{ width: 300 }}
            mode="inline"
          >
            <SubMenu
              key="sub1"
              title="Hello"
            >
              <Menu.Item key="5">list</Menu.Item>
              <Menu.Item key="6">detail</Menu.Item>
            </SubMenu>
          </Menu>
        </Sider>
      </Layout>
    );
  }
}

export default MSider;
